def fibonacci_sequence(length):
    """"""
    if length <= 0:
        return []
    elif length == 1:
        return [0]
    elif length == 2:
        return [0, 1]
    sequence = [0, 1]
    (num1, num2) = (0, 1)
    while len(sequence) < length:
        next_num = num1 + num2
        sequence.append(next_num)
        (num1, num2) = (num2, next_num)
    return sequence
